import { Header } from '../Components/Header'
import { AboutUs } from '../Components/AboutUs'

export const MainPage = () => {
  return (
    <div className='relative w-[100%] h-[100vh] bg-red-600'>
        <Header/>
        <AboutUs/>
    </div>
  )
}
